      SELECT ALL * FROM tab0 (FORMAT parquet) AS cor0 WHERE col2 NOT IN ( - col0 * 25 * - ( + 73 ), - col0, col1 + 7, + 6 * + col1, + - col0 * - col2 + + + col1 );
  - name: tab0

outputs:
  - name: q9639.out
    data: |
      15	81	47
      87	21	10
      97	1	99
